    false,nt"url": null,nt"notes": "This inventory and monitoring plan (IMP)
    documents the inventory and monitoring surveys thatwill be conducted at Two Rivers
    National Wildlife Refuge from 2014 through 2029, or until therefugeu2019s Comprehensive
    Conservation Plan (CCP) and Habitat Management Plan (HMP) arerevised. The majority
    of surveys considered in this plan address resource management objectivesidentified
    in the HMP (2012) for this refuge. Other surveys are a continuation of past monitoringconducted
    for the purpose of understanding long-term trends in specific resources or are part
    ofregional and national survey efforts. This IMP was developed according to the
    Inventory andMonitoring (I&M) policy (701 FW 2) for the National Wildlife Refuge
    System. This plan documents and prioritizes inventory and monitoring surveys and
    research currently conducted, and proposed to be conducted, at the Two Rivers from
    2014 to 2029. This document was developed in collaboration with the Serviceu2019s
    Inventory and Monitoring Initiative, and in accordance with revised Service policy
